import React, { useEffect, useState } from 'react';
import {
  Container,
  Card,
  CardContent,
  Typography,
  Button,
  Grid,
  CircularProgress,
  Box,
} from '@mui/material';
import RefreshIcon from '@mui/icons-material/Refresh';
import { getInvestmentData } from './googleSheetService';

function App() {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);

  const fetchData = async () => {
    setLoading(true);
    try {
      const sheetData = await getInvestmentData();
      setData(sheetData);
    } catch (error) {
      console.error("Failed to fetch data:", error);
      setData(null); // Reset on error
    }
    setLoading(false);
  };

  useEffect(() => {
    fetchData();
  }, []);

  if (loading && !data) {
    return (
      <Container maxWidth="sm" sx={{ mt: 6, textAlign: 'center' }}>
        <CircularProgress />
      </Container>
    );
  }

  return (
    <Container maxWidth="sm" sx={{ mt: 6 }}>
      <Card elevation={4}>
        <CardContent>
          <Typography variant="h6" align="center" color="text.secondary" gutterBottom>
            Current Value
          </Typography>
          <Typography variant="h3" align="center" color="primary" gutterBottom>
            ₹ {data?.currentValue || '-'}
          </Typography>
          <Typography align="center" sx={{ mb: 2 }}>
            Total Returns{' '}
            <span style={{ color: '#2ecc40' }}>
              ↑ ₹ {data?.totalReturns || '-'} ({data?.returnsPercent || '-'})
            </span>
          </Typography>
          <Grid container spacing={2} sx={{ mb: 2 }}>
            <Grid item xs={4} textAlign="center">
              <Typography variant="body2" color="text.secondary">Invested</Typography>
              <Typography variant="subtitle1" color="primary">₹ {data?.invested || '-'}</Typography>
            </Grid>
            <Grid item xs={4} textAlign="center">
              <Typography variant="body2" color="text.secondary">XIRR</Typography>
              <Typography variant="subtitle1" color="primary">{data?.xirr || '-'}</Typography>
            </Grid>
            <Grid item xs={4} textAlign="center">
              <Typography variant="body2" color="text.secondary">1 Day Return</Typography>
              <Typography variant="subtitle1" color="primary">
                ₹ {data?.dayReturn || '-'} ({data?.dayReturnPercent || '-'})
              </Typography>
            </Grid>
          </Grid>
          <Button variant="contained" color="success" fullWidth sx={{ mb: 1 }}>
            Invest more
          </Button>
          <Button variant="outlined" color="primary" fullWidth sx={{ mb: 2 }}>
            Get loan against your investments
          </Button>
          <Grid container spacing={2} justifyContent="center">
            <Grid item>
              <Button variant="text">Portfolio</Button>
            </Grid>
            <Grid item>
              <Button variant="text">Redeem</Button>
            </Grid>
            <Grid item>
              <Button variant="text">Transactions</Button>
            </Grid>
          </Grid>
          <Box textAlign="center" mt={3}>
            <Button
              variant="outlined"
              startIcon={<RefreshIcon />}
              onClick={fetchData}
              disabled={loading}
            >
              {loading ? 'Refreshing...' : 'Refresh'}
            </Button>
          </Box>
        </CardContent>
      </Card>
    </Container>
  );
}

export default App;
